import React from 'react';
import DataTable from '../../services/reactTable';

const AnalysisTable = (props) => {
  let analysisHeader = {
    header: [
      {
        Header: 'Name',
        columns: [
          {
            accessor: 'style_id',
            Cell: (row) => <div className="cellAlign">{row.value}</div>,
          },
        ],
      },
      {
        Header: 'Style Description',
        accessor: 'style_desc',
        Cell: (row) => <div className="cellData">{row.value}</div>,
      },
    ],
  };
  return (
    <div className="tableAlign">
      <DataTable
        columns={analysisHeader.header}
        data={props.tableData}
        isHeaderHidden={true}
        isPagination={false}
        style={{ padding: '0 0rem !important' }}
      />
    </div>
  );
};

export default AnalysisTable;
